import MSFTHeading, { HeadingAlignBaseline, HeadingSize, HeadingTag, } from "./heading";
import headingSchema from "./heading.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { HeadingStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Heading = manageJss(HeadingStyles)(MSFTHeading);
export { HeadingAlignBaseline, Heading, HeadingSize, HeadingTag, headingSchema, };
